import "./sort.css"
const Sort = () => {
    const sortItems = ["Самый дешевый", "Самый быстрый", "Самый оптимальный"]
  return (
    <div className="sort">
      <div className="sort__item active">Самый дешевый</div>
      <div className="sort__item ">Самый быстрый</div>
      <div className="sort__item ">Самый оптимальный</div>
    </div>
  );
};

export default Sort;
